					return 'afternoon1' if $time >= 1200
						&& $time < 1600;
					return 'evening1' if $time >= 1600
						&& $time < 1900;
					return 'morning1' if $time >= 400
						&& $time < 1200;
					return 'night1' if $time >= 1900
						&& $time < 2300;
					return 'night2' if $time >= 2300;
					return 'night2' if $time < 400;
